export default function Navbar() {
    return(
        <nav>
            <ul className="nav--list">
                <a href="#"><li>ABOUT</li></a>
                <a href="#"><li>TL;DR</li></a>
                <a href="#"><li>PROJECTS</li></a>
            </ul>
        </nav>
    )
}
